import './scssPages/hi.scss'


const Hi = () => {
      const fetchData = async () => {
            const response = await fetch("http://localhost:3001/filters")
            if (!response.ok) {
                  throw new Error(`Could not fetch ${url}, status: ${response.status}`);
            }
            const data = await response.json()
            return data;

            return (
                  <div className='hi' >
                        Привет
                  </div>
            );
      }

}

export default Hi;
